INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100101, 44, 16, "人助けが大好き！　前向き格闘娘", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "トゥインクルウィッシュ", 155, "A", "ヒヨリ", 2, 27, "獣人族", "東山奈央", "人助け、応援");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100201, 47, 17, "戦闘のサポートが得意な、心優しい少女", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "トゥインクルウィッシュ", 158, "O", "ユイ", 2, 5, "ヒューマン", "種田梨沙", "料理、人間観察");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100301, 46, 18, "クールで何事にも真っ直ぐな剣士", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "トゥインクルウィッシュ", 163, "B", "レイ", 2, 12, "魔族", "早見沙織", "読書、乗馬、お茶");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100401, 27, 9, "探検好きのイタズラっ子", 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 0, "リトルリリカル", 128, "O", "ミソギ", 5, 10, "ヒューマン", "諸星すみれ", "いたずら、探検");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100501, 40, 12, "ヒーローに憧れる騎士見習いの少女", 11, "？？？", 0, "王宮騎士団（NIGHTMARE）", 146, "O", "マツリ", 8, 25, "獣人族", "下田麻美", "ヒーローごっこ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100601, 42, 13, "甘え上手なみんなの人気者", 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 0, "悪魔偽王国軍（ディアボロス）", 150, "O", "アカリ", 7, 22, "魔族", "浅倉杏美", "サックス");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100701, 32, 14, "プリン大好きゴースト娘", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "悪魔偽王国軍（ディアボロス）", 130, "B", "ミヤコ", 7, 23, "魔族", "雨宮天", "プリンを食べること");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100801, 40, 14, "ボクは誰よりも美しい", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 0, "ヴァイスフリューゲル　ランドソル支部", 150, "AB", "ユキ", 15, 10, "エルフ", "大空直美", "鏡で自分を見ること");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100901, 45, 17, "前世を信じる中二病患者、「疾風の冥姫」", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 0, "トワイライトキャラバン", 159, "A", "アンナ", 13, 5, "魔族", "髙野麻美", "小説執筆");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101001, 42, 16, "マホマホ王国のプリンセス", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 0, "自警団（カォン）", 155, "O", "マホ", 10, 22, "獣人族", "内田真礼", "空想、ぬいぐるみ集め");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101101, 44, 15, "人懐っこくてマシンガントークな妹系少女", 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 0, "ラビリンス", 156, "A", "リノ", 3, 25, "ヒューマン", "阿澄佳奈", "お裁縫");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101201, 46, 17, "みんなのために超能力を使う眠り姫", 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 0, "フォレスティエ", 156, "A", "ハツネ", 6, 24, "エルフ", "大橋彩香", "妹と遊ぶこと、二度寝、昼寝、早寝");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101301, 55, 18, "オタク全開な魔法少女", 8, "", 0, "トワイライトキャラバン", 166, "O", "ナナカ", 13, 21, "魔族", "佳村はるか", "読書、魔法");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101401, 41, 15, "頭脳明晰な美少女名探偵", 11, "test", 0, "自警団（カォン）", 152, "AB", "カスミ", 10, 3, "獣人族", "水瀬いのり", "読書、推理");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101501, 54, 21, "母性溢れる優しいみんなの「ミサト先生」", 9, "test", 0, "フォレスティエ", 165, "O", "ミサト", 6, 5, "エルフ", "國府田マリ子", "絵本作り");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101601, 48, 18, "天真爛漫で人気者のカリスマモデル", 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 0, "ルーセント学院", 167, "O", "スズナ", 14, 10, "魔族", "上坂すみれ", "ファッション");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101701, 53, 19, "いつでも「なんくるないさ～」な天然娘", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 0, "自警団（カォン）", 158, "A", "カオリ", 10, 7, "獣人族", "高森奈津美", "踊り、空手");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (101801, 52, 23, "多くの男性を魅了する無垢な女教師", 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 0, "ルーセント学院", 162, "B", "イオ", 14, 14, "魔族", "伊藤静", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102001, 21, 10, "お歌もにんじんも、ウサギさんも大好き♪", 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 0, "リトルリリカル", 117, "O", "ミミ", 5, 3, "獣人族", "日高里菜", "かわいいもの集め");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102101, 40, 12, "泣き虫で臆病な守ってあげたい女の子", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "サレンディア救護院", 150, "B", "クルミ", 9, 9, "ヒューマン", "植田佳奈", "観劇、おままごと");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102201, 40, 13, "人見知りであまのじゃくな女の子", 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 0, "悪魔偽王国軍（ディアボロス）", 150, "O", "ヨリ", 7, 22, "魔族", "原紗友里", "ゲーム全般");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102301, 38, 14, "ぷうきちといつも一緒！", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, "サレンディア救護院", 148, "B", "アヤネ", 9, 10, "ヒューマン", "芹澤優", "屋内でできる遊び");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102501, 43, 15, "お嬢さまのためにがんばるドジっ娘メイド", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 0, "サレンディア救護院", 154, "O", "スズメ", 9, 12, "ヒューマン", "悠木碧", "ご奉仕");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102601, 42, 17, "遊びと睡眠が何より大事なぐうたら娘", 1, "test", 0, "牧場（エリザベスパーク）", 144, "B", "リン", 11, 1, "獣人族", "小岩井ことり", "あんパン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102701, 43, 16, "運命の相手に一途すぎる乙女", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 0, "トワイライトキャラバン", 154, "B", "エリコ", 13, 30, "魔族", "橋本ちなみ", "実験、裁縫、料理");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102801, 43, 17, "救護院を経営する優しい庶民派お嬢様", 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 0, "サレンディア救護院", 156, "A", "サレン", 9, 4, "エルフ", "堀江由衣", "経営、お茶会");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (102901, 40, 17, "歌って踊れる大人気アイドル", 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 0, "カルミナ", 157, "B", "ノゾミ", 4, 24, "ヒューマン", "日笠陽子", "舞台鑑賞、ダンス");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103001, 51, 16, "トーゴクの神秘、オシエテクダサイ！", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 0, "ヴァイスフリューゲル　ランドソル支部", 163, "O", "ニノン", 15, 31, "ヒューマン", "佐藤聡美", "忍法開発");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103101, 42, 18, "占いが得意な霊能少女", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 0, "悪魔偽王国軍（ディアボロス）", 157, "AB", "シノブ", 7, 22, "魔族", "大坪由佳", "占い");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103201, 45, 18, "一人前の商人を目指すパワフルお嬢様", 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 0, "メルクリウス財団", 157, "AB", "アキノ", 12, 12, "ヒューマン", "松嵜麗", "慈善事業");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103301, 35, 20, "みんなを笑顔にするお笑い牧場主", 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 0, "牧場（エリザベスパーク）", 142, "B", "マヒル", 11, 3, "ヒューマン", "新田恵海", "漫才");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103401, 55, 22, "純情でほっとけない大人の女性", 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 0, "メルクリウス財団", 164, "A", "ユカリ", 12, 16, "エルフ", "今井麻美", "ウインドーショッピング");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103601, 21, 8, "礼儀正しくしっかり者のちびっ子優等生", 2, "test", 0, "リトルリリカル", 118, "A", "キョウカ", 5, 2, "エルフ", "小倉唯", "お勉強");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103701, 43, 13, "義理堅くてからかい好きな剣術少女", 8, "test", 0, "王宮騎士団（NIGHTMARE）", 149, "A", "トモ", 8, 11, "ヒューマン", "茅原実里", "剣術、年長者をからかう");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (103801, 40, 14, "読書が趣味の病弱少女", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 0, "牧場（エリザベスパーク）", 153, "A", "シオリ", 11, 3, "獣人族", "小清水亜美", "読書、お散歩");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104001, 44, 13, "「友達」に憧れる、エルフの森の女の子", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 0, "フォレスティエ", 158, "AB", "アオイ", 6, 6, "エルフ", "花澤香菜", "友達作りのイメトレ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104201, 46, 17, "人々を守るために歌う、唱喚士の少女", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "カルミナ", 163, "O", "チカ", 4, 3, "ヒューマン", "福原綾香", "各種楽器");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104301, 54, 17, "男勝りで情に厚いワイルド娘", 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 0, "自警団（カォン）", 168, "O", "マコト", 10, 9, "獣人族", "小松未可子", "お菓子作り");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104401, 50, "??", "かつては夜を支配した最強の吸血鬼", 5, "test", 0, "悪魔偽王国軍（ディアボロス）", 172, "A", "イリヤ", 7, 5, "魔族", "丹下桜", "世界征服");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104501, 49, 18, "妄想大好き！　ほんとは照れ屋な女の子", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 0, "ヴァイスフリューゲル　ランドソル支部", 157, "AB", "クウカ", 15, 19, "ヒューマン", "長妻樹里", "小説を読むこと");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104601, 48, 18, "弱きを助け強きをくじく猫娘", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "メルクリウス財団", 158, "AB", "タマキ", 12, 1, "獣人族", "沼倉愛美", "猫とたわむれること");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104701, 50, 25, "素顔を見せない冷静沈着な女性騎士", 10, "？？？", 0, "王宮騎士団（NIGHTMARE）", 171, "A", "ジュン", 8, 25, "ヒューマン", "川澄綾子", "格闘技、湯浴み");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104801, 49, 20, "仕事も私事も効率優先な傭兵少女", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "メルクリウス財団", 163, "O", "ミフユ", 12, 11, "ヒューマン", "田所あずさ", "傭兵などのアルバイト");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (104901, 54, 18, "お姉ちゃんがお世話してあげるからねっ！", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 0, "ラビリンス", 168, "O", "シズル", 3, 24, "ヒューマン", "生天目仁美", "家事全般");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (105001, 22, 11, "ちょっとおませな恋に恋する女の子", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0, "ルーセント学院", 120, "A", "ミサキ", 14, 3, "魔族", "久野美咲", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (105101, 53, 27, "実験が趣味の危険な科学者", 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 0, "トワイライトキャラバン", 166, "A", "ミツキ", 13, 7, "ヒューマン", "三石琴乃", "研究、実験");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (105201, 100, 18, "乙女チックなもふもふアニマル", 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 0, "牧場（エリザベスパーク）", 150, "A", "リマ", 11, 14, "獣人族", "徳井青空", "毛繕い、お喋り");
