INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (105701, 45, 17, "空への冒険を夢見る騎空士の少女", 3, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 0, "？？？", 156, "O", "ジータ", "", 10, "ヒューマン", "金元寿子", "冒険、おしゃべり");
