INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (107901, 48, 18, "弱きを助け強きをくじく猫娘", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 0, "メルクリウス財団", 158, "AB", "タマキ（サマー）", 12, 1, "獣人族", "沼倉愛美", "猫とたわむれること");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108001, 49, 20, "仕事も私事も効率優先な傭兵少女", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 0, "メルクリウス財団", 163, "O", "ミフユ（サマー）", 12, 11, "ヒューマン", "田所あずさ", "傭兵などのアルバイト");
