INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108201, 32, 14, "プリン大好きゴースト娘", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 0, "悪魔偽王国軍（ディアボロス）", 130, "B", "ミヤコ（ハロウィン）", 7, 23, "魔族", "雨宮天", "プリンを食べること");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108301, 22, 11, "ちょっとおませな恋に恋する女の子", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 0, "ルーセント学院", 120, "A", "ミサキ（ハロウィン）", 14, 3, "魔族", "久野美咲", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108401, 46, 17, "人々を守るために歌う、唱喚士の少女", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "カルミナ", 163, "O", "チカ（クリスマス）", 4, 3, "ヒューマン", "福原綾香", "各種楽器");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108501, 40, 12, "泣き虫で臆病な守ってあげたい女の子", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "サレンディア救護院", 150, "B", "クルミ（クリスマス）", 9, 9, "ヒューマン", "植田佳奈", "観劇、おままごと");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108601, 38, 14, "ぷうきちといつも一緒！", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, "サレンディア救護院", 148, "B", "アヤネ（クリスマス）", 9, 10, "ヒューマン", "芹澤優", "屋内でできる遊び");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108701, 44, 16, "人助けが大好き！　前向き格闘娘", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 0, "トゥインクルウィッシュ", 155, "A", "ヒヨリ（ニューイヤー）", 2, 27, "獣人族", "東山奈央", "人助け、応援");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108801, 47, 17, "戦闘のサポートが得意な、心優しい少女", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 0, "トゥインクルウィッシュ", 158, "O", "ユイ（ニューイヤー）", 2, 5, "ヒューマン", "種田梨沙", "料理、人間観察");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (108901, 46, 18, "クールで何事にも真っ直ぐな剣士", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 0, "トゥインクルウィッシュ", 163, "B", "レイ（ニューイヤー）", 2, 12, "魔族", "早見沙織", "読書、乗馬、お茶");
